  return (
    <div>
      <form id="form">
        <label htmlFor="email">Email:</label>
        <input
          type="email"
          name="email"
          placeholder="Enter email"
          value={formFilled.email}
          id="email"
          onChange={handleChange}
        />

        <label htmlFor="pwd">Password:</label>
        <input
